import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { Container, Row, Col, Form, Button, Card, Alert } from "react-bootstrap";
import { FaGoogle, FaFacebook } from "react-icons/fa";

const SignupSection = () => {
  const [formData, setFormData] = useState({
    fullName: "",
    email: "",
    password: "",
  });
  const [error, setError] = useState("");
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    try {
      const response = await fetch("http://localhost:5000/api/register", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });
      
      const data = await response.json();
      if (!response.ok) throw new Error(data.message || "Registration failed");
      
      // Chuyển sang trang nhập OTP
      navigate("/verify-otp", { state: { email: formData.email } });
    } catch (err) {
      setError(err.message);
    }
  };

  return (
    <section className="d-flex justify-content-center align-items-center min-vh-100 bg-light">
      <Container>
        <Row className="justify-content-center align-items-center">
          <Col md={5} className="text-md-start text-center mb-4 mb-md-0">
            <h1 className="fw-bold">Create an Account</h1>
            <p className="text-muted">Sign up to get started</p>
          </Col>

          <Col md={5}>
            <Card className="p-4 shadow-sm border-0">
              {error && <Alert variant="danger">{error}</Alert>}
              <Form onSubmit={handleSubmit}>
                <Form.Group controlId="formName" className="mb-3">
                  <Form.Label>Full Name</Form.Label>
                  <Form.Control
                    type="text"
                    name="fullName"
                    value={formData.fullName}
                    onChange={handleChange}
                    required
                    placeholder="Enter your full name"
                  />
                </Form.Group>

                <Form.Group controlId="formEmail" className="mb-3">
                  <Form.Label>Email</Form.Label>
                  <Form.Control
                    type="email"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    required
                    placeholder="Enter your email"
                  />
                </Form.Group>

                <Form.Group controlId="formPassword" className="mb-3">
                  <Form.Label>Password</Form.Label>
                  <Form.Control
                    type="password"
                    name="password"
                    value={formData.password}
                    onChange={handleChange}
                    required
                    placeholder="Create a password"
                  />
                </Form.Group>

                <Button variant="dark" className="w-100 mb-3" type="submit">
                  Sign Up
                </Button>

                <div className="text-center">
                  <p className="text-muted">Or sign up with</p>
                  <Button variant="outline-dark" className="w-100 mb-2 d-flex align-items-center justify-content-center">
                    <FaGoogle className="me-2" /> Google
                  </Button>
                  <Button variant="outline-dark" className="w-100 mb-2 d-flex align-items-center justify-content-center">
                    <FaFacebook className="me-2" /> Facebook
                  </Button>
                </div>
              </Form>
            </Card>
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default SignupSection;
